import React, { Component, Fragment } from 'react';
import { Tabs } from 'antd-mobile';
import { Card, Button, Carousel, WingBlank } from 'antd-mobile';
import Home from './pape/Home'
import Shope from './pape/Shope'

const tabs = [
    { title: '首页', sub: '1' },
    { title: '商品', sub: '2' },
    { title: '购物栏', sub: '3' },
];


class App extends Component {

    constructor(props) {
        super(props)
        this.state = {
            inputValue: '',
        }
    }

    render() {
        return (
            <Fragment>
                <div style={{ height: 200 }}>
                    <WhiteSpace />
                    <Tabs tabs={tabs}
                        initalPage={'t2'}
                        tabBarPosition="left"
                        tabDirection="vertical"
                    >
                        <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', height: '250px', backgroundColor: '#fff' }}>
                            Content of first tab
      </div>
                        <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', height: '250px', backgroundColor: '#fff' }}>
                            Content of second tab
      </div>
                        <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', height: '250px', backgroundColor: '#fff' }}>
                            Content of third tab
      </div>
                    </Tabs>
                    <WhiteSpace />
                </div>

                <div >
                    <div style={{ backgroundColor: "white" }}>
                        <Card.Header
                            title="共0件"
                            thumb='../static/img/gouwu.svg'
                            extra={
                                <div className="row_center" >
                                    <span style={{ color: "#F44336", flexGrow: "1" }}>$2000 </span>
                                    <div style={{ flexGrow: "0.6" }} ></div>
                                    <Button type="primary" size="small" inline>下单</Button>
                                </div>
                            }
                        />
                    </div>
            

                </div>
            </Fragment >
        );
    }

}

export default App;
